import {Link } from 'react-router-dom';
import React from 'react';
import './browser.css';
import homeicon from'./home.png'
function navBar() {
    return (
        <div className="total">
        <div className="nav homepage">
        <Link to="/" type="img" src={homeicon}><img src={homeicon} alt="Home" height="30px"></img></Link>
        <Link to="/get-started" className="text nv">Get started</Link>

        </div >
        <div className="nav right">
        <Link to="/about-us" className="text nv">About-Us</Link>
        </div>
        </div>
    )
}
export default navBar
